css:
@-moz-document url-prefix("https://www.google.") {

html[manifest^="/_/chrome/newtab/manifest"],
.hp {
background:
  repeating-linear-gradient(90deg, rgba(7, 5, 6, 0.5), rgba(85, 82, 67, 0.5) 1%),
  repeating-linear-gradient(120deg, rgb(7, 5, 6), rgb(85, 82, 67) 0.5%);
}
html[manifest^="/_/chrome/newtab/manifest"] > body {
  background-color: transparent !important;
}

html[manifest^="/_/chrome/newtab/manifest"] #lga,
.hp #lga {position: relative}
html[manifest^="/_/chrome/newtab/manifest"] #lga:before,
.hp #lga:before {
  content: "";
  position: absolute;
  width: 100%; height: 200%; left: 0; top: -100px;
  /* Giambologna, Fountain of Neptune (Bologna, 1565) */
  /* http://wtfarthistory.com/tagged/Breast/page/2 */
  background: url('http://38.media.tumblr.com/tumblr_mbzmt5NZ2B1qggdq1.jpg')
   no-repeat top center;
  background-size: auto;
  z-index: -1;
}
html[manifest^="/_/chrome/newtab/manifest"] #hplogo,
.hp #hplogo {
  padding-left: 30px;
  padding-right: 269px;
  width: 0;
  background: url('data:image/png;base64,')
   bottom right no-repeat;
  background-size: 239px auto;
}

html[manifest^="/_/chrome/newtab/manifest"] #gb#gb a.gb_ka,
html[manifest^="/_/chrome/newtab/manifest"] #gb#gb a.gb_la,
.hp #gb#gb a.gb_ka,
.hp #gb#gb a.gb_la {
  color: #ccc;
}
html[manifest^="/_/chrome/newtab/manifest"] #gb#gb a.gb_ka:hover,
html[manifest^="/_/chrome/newtab/manifest"] #gb#gb a.gb_la:hover,
html[manifest^="/_/chrome/newtab/manifest"] #gb#gb a.gb_ka:focus,
html[manifest^="/_/chrome/newtab/manifest"] #gb#gb a.gb_la:focus,
.hp #gb#gb a.gb_ka:hover,
.hp #gb#gb a.gb_la:hover,
.hp #gb#gb a.gb_ka:focus,
.hp #gb#gb a.gb_la:focus {
  color: #fff;
}
.hp .gb_Ea .gb_ga {
  background-position: -220px 0px;
}

DIV#hplogo {
  height: 95px !important;
  width: 0px !important;
  margin-top: 112px;
}
DIV#hplogo * {
  display: none !important;
}



HTML[manifest] .gb_a,
.hp .gb_a {
  background: rgb(85, 82, 67);
  border-color: rgb(7, 5, 6);
}
HTML[manifest] #fbar,
.hp #fbar {
  background-color: rgb(7, 5, 6);
  border-top-color: rgb(85, 82, 67);
}

}
